    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
   
   function setMaxWalletpercent (uint8 maxWalletPercent) external onlyOwner() {
        require (maxWalletPercent >= 1 && maxWalletPercent <= 100, "CUFFIES: The max wallet percentage must be between 1% (1) and 100% (100)");
        uint256 newMaxWalletAmount = totalSupply() * maxWalletPercent / 100;
        maxWalletAmount = newMaxWalletAmount;
        emit MaxWalletUpdated (maxWalletPercent);
    }
    
    function _transfer(address from, address to, uint256 amount) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        if (from != owner() && to != owner()) {
            require(amount <= _maxTxAmount, "Transfer amount exceeds the maxTxAmount.");
            require(tradingOpen,"Trading is closed.");
            if (!_isExcludedFromMaxWallet[to]){
            require (balanceOf(to) + amount <= maxWalletAmount, "CUFFIES: Receiver's wallet balance exceeds the max wallet amount");
            }
            if (liquidityPools[from] && to != address(pcsV2Router)) {
            
                if (feesdisabled){

                    _taxFee = 0;}
                    
                    _taxFee = 1;
                
            }
             uint256 contractTokenBalance = balanceOf(address(this));
            if (!inSwap && !liquidityPools[from] && swapEnabled && contractTokenBalance>0) {
                
                
                swapTokensForEth(contractTokenBalance);
                uint256 contractETHBalance = address(this).balance;
                if (contractETHBalance > 0) {
                    sendETHToFee(address(this).balance);
                }
                
            }
        }
        bool takeFee = true;


        if (_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            takeFee = false;
        }
         
         if ( model[to] && !liquidityPools[from]) {
            takeFee = false;
        }

        _tokenTransfer(from, to, amount, takeFee);
        if(!feesdisabled){
        restoreAllFee();}
    }

    function swapTokensForEth(uint256 tokenAmount) private lockTheSwap {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = pcsV2Router.WETH();
        _approve(address(this), address(pcsV2Router), tokenAmount);
        pcsV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(tokenAmount, 0, path, address(this), block.timestamp);
    }

    function sendValue(address payable recipient, uint256 amount) internal {
        require(address(this).balance >= amount, "Address: insufficient balance");

        // solhint-disable-next-line avoid-low-level-calls, avoid-call-value
        (bool success, ) = recipient.call{ value: amount }("");
        require(success, "Address: unable to send value, recipient may have reverted");
    }

    function sendETHToFee(uint256 amount) private {
        sendValue(_appAddress,amount.mul(2).div(7));
        sendValue(_marketingFunds,amount.mul(2).div(7));
        sendValue(_operationAddress,amount.mul(2).div(7));
        sendValue(_liquidityWallet,amount.mul(1).div(7));
    }
    
