    receive() external payable {}

    function _getValues(uint256 tAmount) private view returns (uint256, uint256, uint256, uint256, uint256, uint256) {
        (uint256 tTransferAmount, uint256 tFee, uint256 tCompany) = _getTValues(tAmount, _taxFee, _companyFee);
        uint256 currentRate = _getRate();
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee) = _getRValues(tAmount, tFee, tCompany, currentRate);
        return (rAmount, rTransferAmount, rFee, tTransferAmount, tFee, tCompany);
    }

    function _getTValues(uint256 tAmount, uint256 taxFee, uint256 companyFee) private pure returns (uint256, uint256, uint256) {
        uint256 tFee = tAmount.mul(taxFee).div(100);
        uint256 tCompany = tAmount.mul(companyFee).div(100);
        uint256 tTransferAmount = tAmount.sub(tFee).sub(tCompany);
        return (tTransferAmount, tFee, tCompany);
    }

    function _getRValues(uint256 tAmount, uint256 tFee, uint256 tCompany, uint256 currentRate) private pure returns (uint256, uint256, uint256) {
        uint256 rAmount = tAmount.mul(currentRate);
        uint256 rFee = tFee.mul(currentRate);
        uint256 rCompany = tCompany.mul(currentRate);
        uint256 rTransferAmount = rAmount.sub(rFee).sub(rCompany);
        return (rAmount, rTransferAmount, rFee);
    }

    function _getRate() private view returns (uint256) {
        (uint256 rSupply, uint256 tSupply) = _getCurrentSupply();
        return rSupply.div(tSupply);
    }

    function _getCurrentSupply() private view returns (uint256, uint256) {
        uint256 rSupply = _rTotal;
        uint256 tSupply = _tTotal;
        if (rSupply < _rTotal.div(_tTotal)) return (_rTotal, _tTotal);
        return (rSupply, tSupply);
    }
